    render() {
        return (
            <ThemeContextConsumer>
                {context => (
            <div className={`sidebar sidebar_${context.theme}`}>
                <div className="container">

                </div>
            </div>
                )}
            </ThemeContextConsumer>
        )
    }
}


export default Sidebar
